import "./NewExpense.css";
const NewExpense = () => {
  return (
    <div className="new-expense">
      <form>
        <div classname="">
          <lable>Date:</lable>
          <input type="date" min="01-01-2019" max="31-12-2022" />
        </div>
        <div classname="">
          <lable>Title:</lable>
          <input type="text" />
        </div>
        <div classname="">
          <lable>Amount:</lable>
          <input type="number" min="0.01" step="0.01" />
        </div>
        <button>Add Expense</button>
      </form>
    </div>
  );
};
export default NewExpense;
